import { Grid, Paper, TextField, Typography, Button } from '@material-ui/core';
import React from 'react'

const SignUp=()=> {

    const paperStyle={padding:'30px 20px', width:300, margin:"20px, auto"}
    const headerStyle={margin:0}

    return(
            <Grid>
                <Paper elevation={20} style={paperStyle}>
                    <Grid align='center'>
                        <h2 style={headerStyle}>Sign Up</h2>
                        <Typography variant='caption'>Please fill this form</Typography>
                    </Grid>
                    <form>
                        <TextField fullWidth label='E-mail' placeholder="Enter your e-mail address"/>
                        <TextField fullWidth label='Password' placeholder="Enter your password"/>
                        <TextField fullWidth label='Confirm Password' placeholder="Please confirm your password"/>
                        {/* line dividing the sign up sheet */}
                        <TextField fullWidth label='Username' placeholder="Enter your username"/>
                        <TextField fullWidth label='Phone Number' placeholder="Enter your phone number"/>
                        <Button type='submit' variant='contained' color='primary'>Sign Up</Button>
                    </form>
                </Paper>
            </Grid>
    )
}

export default SignUp;
